    PROVINCE varchar(100),
    POSTAL_CODE varchar(15) NOT NULL,
    ADDRESS varchar(150),
    COUNTRY varchar(100),
    ACCOUNT_ENABLED NUMBER(1),
    VERSION integer,
    PASSWORD varchar(255) NOT NULL
) ;

COMMIT;

