    CUSTOM4 varchar(255),
    CUSTOM5 varchar(255),
    STATE varchar(64),
    COUNTRY varchar(64),
    FAMILY_NAME varchar(64),
    PREFIX varchar(50),
    SUFFIX varchar(50),
    GIVEN_NAME varchar(64),
    GENDER_CD integer,
    NATIONALITY_CD integer,
    NAME_TYPE_CD integer,
    CREATOR_ID integer NOT NULL,
    RELIGION_CD integer,
    ETHNIC_GROUP_CD integer,
    CHANGED_BY_ID integer,
